// src/components/ViewerManagement.js
import React from 'react';
import '../../CSS/ViewerManagement'; // Import your CSS file

const ViewerManagement = ({ onAddViewer, onRemoveViewer, onViewViewers, onBack }) => (
  <div className="viewer-management">
    <h2>Manage Viewers</h2>
    <div className="button-group">
      <button className="btn btn-add" onClick={onAddViewer}>Add Viewer</button>
      <button className="btn btn-remove" onClick={onRemoveViewer}>Remove Viewer</button>
      <button className="btn btn-view" onClick={onViewViewers}>View Viewers</button>
      <button className="btn btn-back" onClick={onBack}>Back to Admin Options</button>
    </div>
  </div>
);

export default ViewerManagement;
